import './App.css';
import React, {useEffect, useState} from 'react';
import Header from './components/header';
import Home from './components/home';
import './index.css';
import Footer from './components/footer';

function App() {
  return (
    <div className="App">
      <Header />
      <Home />
      <Footer />
    </div>
  );
}

export default App;
